	public class ColliderInfo : MonoBehaviour
	{
		[AttributeUsage(AttributeTargets.Field, Inherited = false, AllowMultiple = false)]
		public sealed class ColliderTypeInfoAttribute : Attribute
		{
			public string Description { get; private set; }

			public int Layer { get; private set; }

			public ColliderTypeInfoAttribute(string description, string layer)
			{
				Description = description;
				Layer = LayerMask.NameToLayer(layer);
			}
		}

		public enum ColliderType
		{
			[ColliderTypeInfo("Normal everyday collisions. Can be hit by attacks", "Default")]
			Default,
			[ColliderTypeInfo("Characters can use this collider for interacting. This dos NOT cause physical collisions!", "PlayerInteractable")]
			Interactable,
			[ColliderTypeInfo("Used for hit boxes. Can be hit by attacks, but does not block movement.", "HittableColliders")]
			Hittable,
			[ColliderTypeInfo("Used for collision that only affects the player. Other objects will pass through (ie, projectiles) but stop the player.", "PlayerOnly")]
			PlayerOnly,
			[ColliderTypeInfo("Used for World Trigger overlaps.", "WorldTriggers")]
			WorldTrigger,
			[ColliderTypeInfo("Normal everyday collisions, but does not affect navigation. Used for dynamic objects.", "DefaultNoBake")]
			DefaultNoNavBake
		}

		[SerializeField]
		private ColliderType colliderType;

		private Collider[] cachedColliders;

		public ColliderType Type
		{
			get
			{
				return colliderType;
			}
			set
			{
				colliderType = value;
			}
		}

		public Collider[] CachedColliders => cachedColliders ?? (cachedColliders = GetColliderOnObjectAndChildren(base.gameObject).ToArray());

		private List<Collider> GetColliderOnObjectAndChildren(GameObject targetObject)
		{
			List<Collider> list = targetObject.GetComponents<Collider>().ToList();
			for (int i = 0; i < targetObject.transform.childCount; i++)
			{
				list.AddRange(GetColliderOnObjectAndChildren(targetObject.transform.GetChild(i).gameObject));
			}
			return list;
		}

		private void Awake()
		{
			ColliderTypeInfoAttribute infoAttribute = GetInfoAttribute(colliderType);
			SetLayerOnObjectAndChildren(base.gameObject, infoAttribute.Layer);
		}

		private void SetLayerOnObjectAndChildren(GameObject targetGameObject, int layer)
		{
			targetGameObject.layer = layer;
			for (int i = 0; i < targetGameObject.transform.childCount; i++)
			{
				SetLayerOnObjectAndChildren(targetGameObject.transform.GetChild(i).gameObject, layer);
			}
		}

		public void SetCollidersEnabled(bool enabled)
		{
			Collider[] array = CachedColliders;
			for (int i = 0; i < array.Length; i++)
			{
				array[i].enabled = enabled;
			}
		}

		public static ColliderTypeInfoAttribute GetInfoAttribute(ColliderType colliderType)
		{
			return typeof(ColliderType).GetField(colliderType.ToString()).GetCustomAttributes(inherit: false).OfType<ColliderTypeInfoAttribute>()
				.SingleOrDefault();
		}

		public float GetDistanceFromPoint(Vector3 position)
		{
			float num = float.MaxValue;
			Collider[] array = CachedColliders;
			foreach (Collider collider in array)
			{
				float num2 = Vector3.Distance(position, collider.ClosestPoint(position));
				if (num2 < num)
				{
					num = num2;
				}
			}
			return num;
		}
	}
	public class ColliderInfoValidator : ReferenceBaseValidator
	{
		private readonly IEnumerable<ColliderInfo> collection;

		private readonly ColliderInfo.ColliderType desiredType;

		private readonly string failureMessage;

		public ColliderInfoValidator(ReferenceBase source, ColliderInfo info, ColliderInfo.ColliderType desiredType, string failureMessage)
			: base(source)
		{
			collection = new ColliderInfo[1] { info };
			this.desiredType = desiredType;
			this.failureMessage = failureMessage;
			autoFixFunction = AutoFix;
		}

		public ColliderInfoValidator(ReferenceBase source, IEnumerable<ColliderInfo> collection, ColliderInfo.ColliderType desiredType, string failureMessage)
			: base(source)
		{
			this.collection = collection;
			this.desiredType = desiredType;
			this.failureMessage = failureMessage;
			autoFixFunction = AutoFix;
		}

		public void AutoFix()
		{
			foreach (ColliderInfo item in collection)
			{
				item.Type = desiredType;
			}
		}

		public override List<ValidationResult> PassesValidation()
		{
			if (!collection.All((ColliderInfo info) => info != null && info.Type == desiredType))
			{
				return ValidationResult.Fail(failureMessage, Source);
			}
			return ValidationResult.Pass();
		}
	}
