		public Vector3Int GetBoundingSize()
		{
			Vector3[] allOffsets = GetAllOffsets();
			Vector3Int result = new Vector3Int(int.MinValue, int.MinValue, int.MinValue);
			Vector3Int vector3Int = new Vector3Int(int.MaxValue, int.MaxValue, int.MaxValue);
			for (int i = 0; i < allOffsets.Length; i++)
			{
				vector3Int.x = ((allOffsets[i].x < (float)vector3Int.x) ? Mathf.FloorToInt(allOffsets[i].x) : vector3Int.x);
				vector3Int.y = ((allOffsets[i].y < (float)vector3Int.y) ? Mathf.FloorToInt(allOffsets[i].y) : vector3Int.y);
				vector3Int.z = ((allOffsets[i].z < (float)vector3Int.z) ? Mathf.FloorToInt(allOffsets[i].z) : vector3Int.z);
				result.x = ((allOffsets[i].x > (float)result.x) ? Mathf.FloorToInt(allOffsets[i].x) : result.x);
				result.y = ((allOffsets[i].y > (float)result.y) ? Mathf.FloorToInt(allOffsets[i].y) : result.y);
				result.z = ((allOffsets[i].z > (float)result.z) ? Mathf.FloorToInt(allOffsets[i].z) : result.z);
			}
			result.x = Mathf.Max(result.x - vector3Int.x, 0) + 1;
			result.y = Mathf.Max(result.y - vector3Int.y, 0) + 1;
			result.z = Mathf.Max(result.z - vector3Int.z, 0) + 1;
			return result;
		}

		public Vector3[] GetLocalCellPositions()
		{
			if (PropLocationOffsets == null)
			{
				return new Vector3[1] { Vector3.zero };
			}
			Vector3[] allOffsets = GetAllOffsets();
			Vector3 vector = new Vector3(applyXOffset ? (-0.5f) : 0f, 0f, applyZOffset ? (-0.5f) : 0f);
			for (int i = 0; i < PropLocationOffsets.Count; i++)
			{
				allOffsets[i].x += vector.x;
				allOffsets[i].y += vector.y;
				allOffsets[i].z += vector.z;
			}
			return allOffsets;
		}

		private Vector3[] GetAllOffsets()
		{
			if (PropLocationOffsets != null)
			{
				Vector3[] array = new Vector3[PropLocationOffsets.Count];
				for (int i = 0; i < PropLocationOffsets.Count; i++)
				{
					array[i] = PropLocationOffsets.ElementAt(i).Offset;
				}
				return array;
			}
			return new Vector3[1] { Vector3.zero };
		}

		public void SetPropLocationOffsets(PropLocationOffset[] newPropLocationOffsets)
		{
			propLocationOffsets = newPropLocationOffsets;
		}
	}
