		public static string GetNamedStringsSnippet(string snippetName, List<string> keys)
		{
			return GetNamedStringsSnippet(snippetName, keys, keys);
		}

		public static string GetNamedStringsSnippet(string snippetName, List<string> keys, List<string> values)
		{
			StringBuilder stringBuilder = new StringBuilder(snippetName);
			stringBuilder.Append(" = {");
			for (int i = 0; i < keys.Count; i++)
			{
				stringBuilder.Append(keys[i]);
				stringBuilder.Append("=\"");
				stringBuilder.Append(values[i]);
				stringBuilder.Append('"');
				if (i < keys.Count - 1)
				{
					stringBuilder.Append(", ");
				}
			}
			stringBuilder.Append("}\n");
			return stringBuilder.ToString();
		}

		public (string key, List<string> names) GetTransforms()
		{
			List<string> item = (from sr in scriptReferences
				where sr.Type == ScriptReference.ReferenceType.Transform
				select sr.NameInCode).ToList();
			return (key: "Transforms", names: item);
		}

		public string GetTransformReferenceSnippet(Prop prop)
		{
			IEnumerable<ScriptReference> source = scriptReferences.Where((ScriptReference sr) => sr.Type == ScriptReference.ReferenceType.Transform);
			List<string> keys = source.Select((ScriptReference sr) => sr.NameInCode).ToList();
			List<string> list = source.Select((ScriptReference sr) => sr.ReferenceId).ToList();
			prop.RemapTransforms(list);
			return GetNamedStringsSnippet("Transforms", keys, list);
		}

